import React from 'react';
import { Link } from 'react-router-dom';
import { Navibar } from '../component/Navibar'
import Spinner from 'react-bootstrap/Spinner'
import Table from 'react-bootstrap/Table';
import { api } from '../services/api.service';

import { userService } from '../services/user.service';
import { parse } from '../helpers/exomiser-parser';

class SamplePage extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            user: {},
            users: [],
            proband: {},
            data: []
        };
    }

    componentDidMount() {
        this.setState({ 
            user: JSON.parse(localStorage.getItem('user')),
            users: { loading: true },
            proband: window.location.pathname.split(':')[1],
            isLoading: true,
            data: { loading: true }
        });

        api.getProbandById(window.location.pathname.split(':')[1]).then(data => {
            const { genes, raw } = parse(data);
            this.setState({ data: genes })
            this.setState({ isLoading: false})
        })
    }

    render() {
        const { user, users, proband, data, isLoading } = this.state;

        return (

            <div>

                <Navibar></Navibar>
                <div>
                    <h1 style={{ fontSize: "50px" }}>Proband - <i style={{ fontSize: "50px" }}>{proband.toString()}</i></h1>
                </div>
                <br></br>
                {isLoading && 
                    <Spinner animation="border" role="status">
                    <span className="sr-only">Loading...</span>
                    </Spinner>
                }
                {!isLoading &&
                    data.map((value, index) => (
                        <div>
                            <div className="jumbotron jumbotron-fluid">
                                <div className="container">
                                <h1>{value.name}</h1>
                                    <div className="row">
                                        <div className='col-md-8'>
                                            <p>Inheritance of Gene: {value.compatibleInheritanceModes.map((value, index) => (
                                                <li>{value}</li>
                                            ))}</p>
                                            <p>Associated Diesease: {value.priorityResults.HIPHIVE_PRIORITY.phenotypeEvidence.map((value, index) => (
                                                <li>{JSON.stringify(value)}</li>
                                            ))}</p>
                                            <p>Associated Diesease: {value.priorityResults.OMIM_PRIORITY.associatedDiseases.map((value, index) => (
                                                <li>{JSON.stringify(value)}</li>
                                            ))}</p>
                                        </div>
                                        <div className='col-md-4'>
                                            <p style={{ textAlign: "right" }}>Variant Score: {value.variantScore}</p>
                                            <p style={{ textAlign: "right" }}>Priority Score: {value.priorityScore}</p>
                                            <p style={{ textAlign: "right" }}>Combined Score: {value.combinedScore}</p>                                        
                                        </div>
                                    </div>
                                    <div className="row"> 
                                        <Table striped bordered hover variant="dark">
                                            <thead>
                                                <tr>
                                                    <th>Chromosome</th>
                                                    <th>Mutation</th>
                                                    <th>Variant Effect</th>
                                                    <th>Variant Score</th>
                                                    <th>Inheritance Mode</th>
                                                    <th>Phred Score</th>
                                                    <th>Frequency Score</th>
                                                </tr>
                                            </thead>
                                            <tbody>
                                                {value.variantEvaluations.map((value, index) => (
                                                <tr>
                                                    <td>{value.chromosomeName}</td>
                                                    <td style={{ maxWidth: "10px", wordWrap: "break-word" }}>{value.position}.{value.ref}{'>'}{value.alt}</td>
                                                    <td>{value.variantEffect}</td>
                                                    <td>{value.variantScore}</td>
                                                    <td>{value.contributingInheritanceModes}</td>
                                                    <td>{value.phredScore}</td>
                                                    <td>{value.frequencyScore}</td>

                                                </tr>
                                                ))}
                                            </tbody>
                                        </Table>
                                    </div>
                                </div>
                            </div>
                        </div>
                    ))
                }

            </div>
        );
    }
}

export { SamplePage };
